INSERT INTO `aca_email_template` (`EMAIL_TEMPLATE_ID`, `EMAIL_SUBJECT`, `EMAIL_BODY`, `ACTIVE_STATUS`, `CREATED_BY`, `CREATE_DATE`, `UPDATED_BY`, `UPDATE_DATE`) VALUES
(3, 'Notification of Employment Termination ', '<p><p>Dear All,</p>\r\n<p>This is to bring your kind notice that, effective today; Mr.\r\nGaji Md. Asif-u-Doullah, Programmer - PHP is no longer with ATI Limited. All\r\nare instructed not to make any correspondence or share any information with Mr.\r\nGaji Asif related the matters of ATI Limited. Due to insubordination,\r\nnon-compliance of office rules & regulations and continuous\r\nunderperformance, this termination order has been executed.  </p>\r\n<p>NB: All are instructed not to disclose or share this mail to\r\nanyone or outside of ATI Limited.  </p>\r\n<p>Thank\r\nyou and  Regards</p>\r\n\r\n</p>', 1, 1, '2018-04-08 07:58:41', 1, NULL),
(5, 'Holiday Notice', '<p><p>Dear All,&nbsp;</p>\r\n\r\n<p>Please\r\nbe informed that ATI Business Office shall be closed on Monday, March 26, 2018.\r\nOn this very special occasion, we commemorate the country''s&nbsp;<a href="https://en.wikipedia.org/wiki/Proclamation_of_Bangladeshi_Independence"><span>declaration of independence</span></a>&nbsp;from&nbsp;<a href="https://en.wikipedia.org/wiki/Pakistan">Pakistan</a>&nbsp;in\r\nthe late hours of 25 March 1971.</p>\r\n\r\n<p>Office\r\nshall remain open from Tuesday, March 27, 2018 onwards at regular business\r\nhour.We hope you will enjoy the holiday with your family and friends.</p>\r\n<p>With Thanks</p>\r\n<p>Dewan\r\nHabiba</p>\r\n\r\n<p>Coordinator,\r\nHR &amp; BSE</p>\r\n\r\n<p>Tel- +88 02\r\n58955573; +88 02 48953302</p>\r\n\r\n<p>E-mail- <a href="mailto:habiba@atilimited.net">habiba@atilimited.net</a></p>\r\n\r\n<p><b>ATI </b><b>Limited</b></p>\r\n\r\n<br></p>', 1, 1, '2018-04-08 08:37:23', NULL, NULL);
